import React, { useEffect } from "react";
import M from "materialize-css";

const Parallax = () => {
	const imglink1 =
		"https://www.securitas.in/globalassets/india/images/general-images/top-images-1400-x-600/securitas-in-india_web_1440x600.jpg";
	const imglink2 =
		"https://i.pinimg.com/originals/d8/bb/3c/d8bb3c7f91d833d34a1c8e2f2bc21544.jpg";

	useEffect(() => {
		const elems = document.querySelectorAll(".parallax");
		M.Parallax.init(elems, {});
	}, []);

	return (
		<div>
			<div class="parallax-container">
				<div class="parallax">
					<img src={imglink1} />
				</div>
			</div>
			<div class="section white">
				<div class="row container">
					<h2 class="header">Safe and Sound</h2>
					<p class="grey-text text-darken-3 lighten-3">
						We have 20 years of experience in security in Army. We
						provide all type of services like Bouncers, Gunmen,
						Civil Guards & Detectives etc.
					</p>
					<p class="grey-text text-darken-3 lighten-3">
						We have 20 years of experience in security in Army. We
						provide all type of services like Bouncers, Gunmen,
						Civil Guards & Detectives etc.
					</p>
					<p class="grey-text text-darken-3 lighten-3">
						We have 20 years of experience in security in Army. We
						provide all type of services like Bouncers, Gunmen,
						Civil Guards & Detectives etc.
					</p>
					<p class="grey-text text-darken-3 lighten-3">
						We have 20 years of experience in security in Army. We
						provide all type of services like Bouncers, Gunmen,
						Civil Guards & Detectives etc.
					</p>
					<a class="waves-effect waves-light btn">View More</a>
				</div>
			</div>
			<div class="parallax-container">
				<div class="parallax">
					<img src={imglink2} />
				</div>
			</div>
		</div>
	);
};

export default Parallax;
